const inicioState = {
    detail: [],
   
}


function rootReducer (state = inicioState, action) {
    switch(action.type){
        case 'GET_DETAIL':
            return{
                ...state,
                detail: action.payload
            }
            default:
            return state;
    }
}

export default rootReducer
